var listCartItem = false;
var cart =
{
  init : function()
  {
    $.ajax(
    {
      url : "/shoppingcart/show?currency=" + region,
      type : "GET",
      dataType : 'json',
      cache : false,
      success : function( data, status, xhr )
      {
        listCartItem = data;
        $( ".shopping-cart-menu-content ul.media-list" ).eq( 0 ).empty();
        if ( data.cart.length == 0 )
        {
          $( ".shopping-cart-menu-content ul.media-list" ).eq( 0 ).append( '<li class="empty">' + objLang.shoppingcart.empty + '</li>' );
        } else
        {
          for ( var k in data.cart )
          {
            var srcitem = data.cart[ k ];

            var newItem = '<li class="media">' + '<a type="button" class="close remove-from-cart" onclick="cart.del(\'' + srcitem.PID + '\',\'' + srcitem.formatType
                + '\');"><span class="glyphicon glyphicon-remove" aria-hidden="true"></span></a>' + '<a href="' + srcitem.href + '" class="pull-left">' + '<img src="' + srcitem.src
                + '" class="media-object" alt="' + srcitem.alt + '" style="  max-width: 50px;">' + '</a>' + '<div class="media-body">' + '<div class="media-heading">' + '<a href="' + srcitem.href
                + '">' + srcitem.name + '</a>' + '</div>' + '<p class="cart-item">' + '<span class="quantity">' + srcitem.qty + '  <span class="amount fcurrency">'
                + parseFloat( srcitem.showPrice ).toFixed( 2 ) + '</span></span>' + '</p>' + '</div>' + '</li>';

            $( ".shopping-cart-menu-content ul.media-list" ).eq( 0 ).append( newItem );
          }
        }

        $( "#shopping-cart-menu .total > .amount" ).text( data.total );
        $( ".shopping-cart-block .hightlight > .qty" ).text( data.count );
        $( ".shopping-cart-block .hightlight > .amount" ).text( data.total.toFixed( 2 ) );

        $( "#shopping-cart-menu .total > .amount" ).formatCurrency(
        {
          colorize : false,
          region : region,
          roundToDecimalPlace : roundToDecimalPlace
        } );
      },
      error : function( xhr, ajaxOptions, thrownError )
      {
        PM.erro(
        {
          title : objLang.shoppingcart.addCartFailureTitle,
          text : objLang.shoppingcart.addCartFailureContent
        } );
      }
    } );
  },
  add : function( PID, qty, formatType, callback )
  {
    $.ajax(
    {
      url : "/shoppingcart/append",
      type : "POST",
      dataType : 'json',
      data :
      {
        'PID' : PID,
        'qty' : qty,
        'formatType' : formatType
      },
      cache : false,
      success : function( data, status, xhr )
      {
        var type = data.code == "200" ? "info" : "danger";
        var title = data.code == "200" ? objLang.shoppingcart.addCartSuccessTitle : objLang.shoppingcart.addCartInsufficientTitle;
        var text = data.code == "200" ? objLang.shoppingcart.addCartSuccessContent : objLang.shoppingcart.addCartInsufficientContent;
        PM.show(
        {
          type : type,
          title : title,
          text : text
        } );
        cart.init();
        callback( true );
      },
      error : function( xhr, ajaxOptions, thrownError )
      {
        PM.erro(
        {
          title : objLang.shoppingcart.addCartFailureTitle,
          text : objLang.shoppingcart.addCartFailureContent
        } );
        cart.init();
        callback( false );
      }
    } );
  },
  setQty : function()
  {

  },
  del : function( PID, formatType )
  {
    $.ajax(
    {
      url : "/shoppingcart/delete",
      type : "POST",
      dataType : 'json',
      data :
      {
        'PID' : PID,
        'formatType' : formatType
      },
      cache : false,
      success : function( data, status, xhr )
      {
        PM.show(
        {
          type : "info",
          title : objLang.shoppingcart.delCartSuccessTitle,
          text : objLang.shoppingcart.delCartSuccessContent
        } );
        cart.init();
      },
      error : function( xhr, ajaxOptions, thrownError )
      {
        PM.erro(
        {
          title : objLang.shoppingcart.addCartFailureTitle,
          text : objLang.shoppingcart.addCartFailureContent
        } );
        cart.init();
      }
    } );
  }
};

function followIt()
{
  $( ".btn-follow-it" ).each( function()
  {

    $( this ).click( function()
    {
      var PID = $( this ).attr( "data-pid" );

      $.ajax(
      {
        url : "/user/followlist/add",
        type : "POST",
        dataType : 'json',
        data :
        {
          'PID' : PID
        },
        success : function( data, status, xhr )
        {
          PM.show(
          {
            type : "info",
            title : objLang.shoppingcart.followItSuccessTitle,
            text : objLang.shoppingcart.followItSuccessContent
          } );
          cart.init();
        },
        error : function( xhr, ajaxOptions, thrownError )
        {
          PM.erro(
          {
            title : objLang.shoppingcart.addCartFailureTitle,
            text : objLang.shoppingcart.addCartFailureContent
          } );
          cart.init();
        }
      } );

    } );
  } );
}
